  call vert_QA_W(wf(:,-2),wf(:,0),wf(:,1))
  call vert_QA_W(wf(:,-1),wf(:,-5),wf(:,2))
  call vert_QA_V(wf(:,-3),wf(:,-4),wf(:,3))
  call vert_QA_V(wf(:,-6),wf(:,-7),wf(:,4))
  call prop_W_W(wf(:,1),Q(:,5),MW,1_intkind1,wf(:,5))
